import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

    info : {

        flex : .5,
        width : '100%',
        marginTop : 20,
        justifyContent : 'space-around',
        alignItems : 'center',
    },

    text : {

        fontSize : 16,
        color : '#fff',
        textDecorationLine : 'underline'
    },
})
